script: |
  super -f text -I q12644.spq | sort > q12644.out

inputs:
  - name: q12644.spq
    data: |
      SELECT ALL + - col1 FROM tab0 (FORMAT parquet) WHERE - 46 * + col1 - 57 <= - + ( - + col1 ) * - + col2 - - + col2;
  - name: tab0

outputs:
  - name: q12644.out
    data: |
      -1
      -21
      -81
